function Schedule() {

  return (
    <div className="schedule">
      <table>
          <thead>
              <tr>
                  <th colSpan="1">時間</th>
                  <th colSpan="1">活動內容</th>
              </tr>
          </thead>
          <tbody>
              <tr>
                  <td>07：30～</td>
                  <td>with two columns</td>
              </tr>
          </tbody>
      </table>

    </div>
  );
};

export default Schedule;
